package com.ua.foxminded.controller.service.testdata;

public class GeneratorDataException extends Exception {
    public GeneratorDataException() {
        super();
    }

    public GeneratorDataException(String message) {
        super(message);
    }

    public GeneratorDataException(String message, Throwable cause) {
        super(message, cause);
    }

    public GeneratorDataException(Throwable cause) {
        super(cause);
    }
}
